import styles from '../../styles/subComp.module.css'

export default function card({heading, description, source}) {
  return (
    <div className={styles.card} style={{backgroundImage: `url(${source})`}}>
      <div>
        <h2>{heading}</h2>
        <p>{description}</p>
      </div>
    </div>
  )
}
